import React from "react";
import "./index.css";
import Grid from "@mui/material/Grid";
import TextField from "@mui/material/TextField";

function index() {
  return (
    <div className="register-box">
      <div class="red-box">
        <h5>Refer a Donor</h5>
      </div>
      <div class="white-box">
        <Grid container spacing={2}>
          <Grid item xs={6}>
            <TextField
              id="outlined-basic"
              label="First Name"
              variant="outlined"
            />
          </Grid>
          <Grid item xs={6}>
            <TextField
              id="outlined-basic"
              label="Last Name"
              variant="outlined"
            />
          </Grid>
        </Grid>
      </div>
    </div>
  );
}

export default index;
